import React, { Component } from 'react';
import './SearchBar.css';
import ReactSearchBox from 'react-search-box';

class SearchBar extends Component {

    constructor(props) {
        super(props);
        this.state = { 
            search: "", 
        }
    }

    setSearchWord = (event) => {
        this.setState({
          search: event.target.value
        });
    }

    render() { 
        return (
            <div className="pencils">
                <div className="text"> Search and Download images for Free</div>
                <div className="search-bar"> 
                    <div className="input-group mb-3">
                        <input type="text" onChange={this.setSearchWord} class="form-control" placeholder="Search free photos" aria-label="Recipient's username" aria-describedby="basic-addon2"/>
                        <div className="input-group-append">
                            <button class="btn btn-outline-secondary" type="button">Search</button>
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default SearchBar;
